import React from "react";

const Header = () => {
  return (
    <header className="px-8">
      <nav>
        <ul>
          <li>
            <a href="#">Main</a>
          </li>
          <li>
            <a href="#">Counting</a>
          </li>
          <li>
            <a href="#">Bas</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
